L["You can custom the text for Quest Accepted, Quest Complete and Objective Progress in %s module's progress customization."] = "你可以在 %s 模块的进度自定义中自定义任务接受, 任务完成和任务目标进度的文字."
L["You can customize the global shadow color, disable some skins, set the level of vignetting, etc."] = "你可以自定义全局阴影的颜色, 禁用一些美化皮肤, 设置画面暗角的颜色深度...等等."
L["You can customize the sentence templates, channels, etc."] = "你可以自定义发送模版, 频道等."
L["You can disable this alert in [%s]-[%s]-[%s]"] = "你可以在 [%s]-[%s]-[%s] 中禁用此提醒."
L["You can disable/enable compatibility check via the option in the bottom of [WindTools]-[Advanced]-[Core]."] = "你可以通过设定位于 [Wind 工具箱]-[高级]-[核心] 底部的选项来启用/停用兼容性检查."
L["You can find the setting in 'ElvUI > %s > %s > %s'."] = "你可以在 ElvUI > %s > %s > %s 中找到此设定."
L["You can find the setting in [%s] - [Tooltips] - [General]."] = "你可以在 [%s] - [鼠标提示] - [一般设定] 中找到此设定."
L["You can limit the config only work in the current realm, otherwise it will work in all realms in the region you configurated above."] = "你可以限制配置仅在当前服务器生效, 否则将会在你上面配置的地区的所有服务器生效."
L["You can limit the config only work in the specific faction."] = "你可以限制配置仅在特定阵营生效."
L["You can limit the config only work in the specific region."] = "你可以限制配置仅在特定地区生效."
L["You can paste any text contains coordinates here, and press ENTER to set the waypoint in map."] = "你可以在这里粘贴任何包含坐标的文字, 然后按 回车键 设置路径点."
L["You can preview the ease type in https://easings.net/"] = "你可以在 https://easings.net/ 中预览缓动类型."
L["You can send your suggestions or bugs via %s, %s, %s and the thread in %s."] = "你可以通过 %s, %s, %s 和在 %s 的帖子来发送你的建议和错误."
L["You can separate the groups with a comma."] = "你可以使用英文逗号 (,) 来分隔按钮组."
L["You can use ElvUI Mover to reposition it."] = "你可以使用 ElvUI 移动器来移动它."
L["You can use |cff00d1b2/wtdebug off|r command to exit debug mode."] = "你可以使用 |cff00d1b2/wtdebug off|r 命令来退出调试模式."
L["You must add FULL NAME of the channel, not the abbreviation."] = "你必须添加完整的频道名称, 而不是缩写."
L["You must enable ElvUI Chat - %s to use abbreviation feature."] = "你必须启用 ElvUI 聊天 - %s 来使用缩写功能."
L["You need hold SHIFT to inspect someone."] = "你需要按住 Shift 来观察其他玩家."
L["You need to install Bigwigs or Details! first."] = "你需要先安装 BigWigs 或 Details!."
L["You need to manually set the bar style to %s in BigWigs first."] = "你需要先在 BigWigs 中手动设定计时条的样式为 %s."
